    id: 3,
    name: "ASHI High Class Performance Stainless Steel",
    image: "./images/product/helmet1.jpg",
    price: 8499,
  },
  {
    id: 4,
    name: "ASHI High Class Guard Stainless Steel",
    image: "./images/product/helmet1.jpg",
    price: 5999,
  },
  {
    id: 5,
    name: "ASHI Classic Match Performance Titanium",
    image: "./images/product/helmet1.jpg",
    price: 4149,
  },
];
export default HelmetCat1;
